import React from 'react';
import Logo from '../Logo/Logo';
import "./Footer.css"

function Footer() {
  return <footer>
  <p>
    We're a team of Professional cooks who are excited about their food,
    amazing skills and expertiness in cooking.
  </p>
  <Logo />
</footer>
}

export default Footer;
